import React from 'react'
import loginbg from '../Images/loginbg.svg'

const Travellerlogin = () => {

    const bgimg = {
        width:"1000px",
        height:"700px",
        margin:"auto",
    }
    const imgstyle = {
        width:"100%",
        height:"100%"
    }
  return (
    <div style={bgimg}>
        <img src={loginbg}  alt="Main image" style={imgstyle}/>  


    </div>
  )
}

export default Travellerlogin;
